/**
 * Interface for property objects.
 * @export
 * @interface IPropertiesInput
 */
export interface IPropertiesInput {
    /**
     * Name of the property.
     * @type {string}
     * @memberof IPropertiesInput
     */
    name: string;
    /**
     * Value of the property.
     * @type {string}
     * @memberof IPropertiesInput
     */
    value: string;
}
